(()=>{"use strict";window.addEventListener("DOMContentLoaded",(()=>{document.querySelectorAll(".accordion").forEach((t=>{t.addEventListener("click",(t=>{if(t.target.classList.contains("accordion__button")){const c=Array.from(t.target.closest(".accordion").children),e=t.target.closest(".accordion__item");function o(){c.forEach((t=>{t.classList.remove("is-active")})),e.classList.add("is-active")}o()}}))}))}))})();